        width: 120px;
        height: 40px;
        position: absolute;
        font-size: 50px;
        line-height: 50px;
        top: 50%;
        left: 50%;
        transform: translateY(-50%) translateX(-50%);
      }

      #app-cockpit-loading span {
        display: inline-block;
        width: 8px;
        height: 100%;
        border-radius: 4px;
        background: rgb(144, 188, 238);
        -webkit-animation: load 1s ease infinite;
      }

      @-webkit-keyframes load {

        0%,
        100% {

          background: rgb(144, 188, 238);
        }

        50% {
          height: 70px;
          margin: -15px 0;
          background: rgb(59, 119, 189);
        }
      }

      #app-cockpit-loading span:nth-child(2) {
        -webkit-animation-delay: 0.2s;
      }

      #app-cockpit-loading span:nth-child(3) {
        -webkit-animation-delay: 0.4s;
      }

      #app-cockpit-loading span:nth-child(4) {
        -webkit-animation-delay: 0.6s;
      }

      #app-cockpit-loading span:nth-child(5) {
        -webkit-animation-delay: 0.8s;
